import React from 'react'
import { Fade } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css'

const slideImages = [
    'https://st4.depositphotos.com/6010472/20337/i/1600/depositphotos_203376426-stock-photo-detergents-cleaning-accessories-pink-color.jpg',
    // 'http://carpetserv.ancorathemes.com/wp-content/uploads/2017/02/wave_17.png',
    // 'https://st4.depositphotos.com/6010472/20628/i/1600/depositphotos_206281076-stock-photo-female-hand-cleaning-pale-pink.jpg',
    'https://cdn5.vectorstock.com/i/1000x1000/95/19/window-cleaning-vector-1059519.jpg',
    // 'https://previews.123rf.com/images/marctran/marctran1707/marctran170700992/82730698-flatlay-of-laptop-cake-macaron-and-cup-of-tea-on-pink-table-beautiful-breakfast-with-macaroon-.jpg',
    'https://www.retailtechinc.com/wp-content/uploads/2020/04/jeshoots-com-__ZMnefoI3k-unsplash.jpg'
//   'https://www.clorox.com/wp-content/uploads/2020/06/clx-hub-cleaning-sanitizing-730.png'
];

const Slider = () => {
    return (
      <div>

        <Fade>

          <div className="each-slide">
            <div className = 'slider' style={{'backgroundImage': `url(${slideImages[0]})`}}>

                <div className='sliderText '>Let Us Do Your <br/> Dirty Work</div>
            </div>
          </div>
          <div className="each-slide">

            <div className = 'slider' style={{'backgroundImage': `url(${slideImages[1]})`}}>
                <div className='sliderText slideUp'>Care For <br/> Your Home</div>
            </div>
          </div>
          <div className="each-slide">

            <div className = 'slider' style={{'backgroundImage': `url(${slideImages[2]})`}}>
                <div className='sliderText slideUp'>Your Experts In Carpet <br/> And Upholstery</div>
            </div>
          </div>
        </Fade>
      </div>
    )
}
export default Slider
